import {useEffect, useState} from "react";
import axios from "axios";

export default function (){
    const [orderList, setOrderList] = useState([]);

    useEffect(()=>{
        axios.get("/orders")
            .then(res =>{
                setOrderList(res.data);
            })

    },[])
    return (
        <div></div>
    )

}
